package main

import (
	"testing"
)

func TestIsAnagram(t *testing.T) {
	tcs := []struct {
		inS1 string
		inS2 string
		out  bool
	}{
		{"", "", true},
		{"a", "a", true},
		{"ab", "ba", true},
		{"abc", "cba", true},
		{"aabb", "bbaa", true},
		{"ad", "bc", false},
		{"aadd", "bbcc", false},
		{
			"",
			"",
			true,
		},
	}

	for idx, tc := range tcs {
		out := isAnagram(tc.inS1, tc.inS2)
		if out != tc.out {
			t.Errorf("%d. isAnagram(%q, %q) = %t. Expected: %t", idx, tc.inS1, tc.inS2, out, tc.out)
		}
	}
}
